#this reads an sdf and returns the cleaned activity dataframe to be used in scikit, as well as the smiles column in which molecules with problematic activity were dropped
def clean_activity_andSMILES_from_inputFile(file_name, activity):
    sdfFile = os.path.join(RDConfig.RDDataDir, file_name)
    if ".csv" in sdfFile:
        frameAll = pd.read_csv(sdfFile)
    elif ".sdf" in sdfFile:
        #need to test compatibility with the infrastructure and change accordingly
        frameAll = PandasTools.LoadSDF(sdfFile,smilesName='SMILES',molColName='Molecule')
    else:
        # print("Error: check input file")
        pass
    activity_filter = frameAll.applymap(np.isreal)[activity]
    frame1 = frameAll[activity_filter == False]
    Y1obj = frame1[activity]
    Y1 = pd.to_numeric(Y1obj, errors='coerce')
    smiles_columndf_object = frame1['SMILES']
    smiles_columndf = pd.DataFrame(smiles_columndf_object)
    return(Y1, smiles_columndf) 


def get_rdkit_descriptors(smiles_dataframe, smiles_title = 'SMILES', general=True, fp= "A", radius_num = 2, nbits_used = 2048):
    supply = [Chem.MolFromSmiles(x) for x in smiles_dataframe[smiles_title]]
    if fp == "F":
        fingerprints = [Chem.GetMorganFingerprintAsBitVect(mol, radius_num, useFeatures=True, nBits= nbits_used) for mol in supply]
    elif fp == "N":
        fingerprints = []
    else:
        fingerprints = [Chem.GetMorganFingerprintAsBitVect(mol, radius_num, nBits= nbits_used) for mol in supply]
    RDKitDescNames = (['Chi0','Chi0n','Chi0v','Chi1',\
    'Chi1n','Chi1v','Chi2n','Chi2v','Chi3n','Chi3v','Chi4n','Chi4v',\
    'EState_VSA1','EState_VSA10','EState_VSA11','EState_VSA2','EState_VSA3',\
    'EState_VSA4','EState_VSA5','EState_VSA6','EState_VSA7','EState_VSA8',\
    'EState_VSA9','FractionCSP3','HallKierAlpha','HeavyAtomCount',\
    'Kappa1','Kappa2','Kappa3','LabuteASA','MolLogP','MolMR','MolWt',\
    'NHOHCount','NOCount','NumAliphaticCarbocycles','NumAliphaticHeterocycles',\
    'NumAliphaticRings','NumAromaticCarbocycles','NumAromaticHeterocycles',\
    'NumAromaticRings','NumHAcceptors','NumHDonors','NumHeteroatoms',\
    'NumRotatableBonds','NumSaturatedCarbocycles','NumSaturatedHeterocycles',\
    'NumSaturatedRings','PEOE_VSA1','PEOE_VSA10','PEOE_VSA11','PEOE_VSA12',\
    'PEOE_VSA13','PEOE_VSA14','PEOE_VSA2','PEOE_VSA3','PEOE_VSA4','PEOE_VSA5',\
    'PEOE_VSA6','PEOE_VSA7','PEOE_VSA8','PEOE_VSA9','RingCount','SMR_VSA1',\
    'SMR_VSA10','SMR_VSA2','SMR_VSA3','SMR_VSA4','SMR_VSA5','SMR_VSA6','SMR_VSA7',\
    'SMR_VSA8','SMR_VSA9','SlogP_VSA1','SlogP_VSA10','SlogP_VSA11','SlogP_VSA12',\
    'SlogP_VSA2','SlogP_VSA3','SlogP_VSA4','SlogP_VSA5','SlogP_VSA6','SlogP_VSA7',\
    'SlogP_VSA8','SlogP_VSA9','TPSA','VSA_EState1','VSA_EState10','VSA_EState2',\
    'VSA_EState3','VSA_EState4','VSA_EState5','VSA_EState6','VSA_EState7',\
    'VSA_EState8','VSA_EState9'])
    calc = MolecularDescriptorCalculator(RDKitDescNames)
    #aggregated descriptors for training set
    Xfp = []
    for fp in fingerprints:
        arr = np.zeros((1,))
        DataStructs.ConvertToNumpyArray(fp, arr)
        Xfp.append(arr)
    df_fp = pd.DataFrame(Xfp)     
    df_fp.columns = ["MFP"+f'{i:04}' for i in range(nbits_used)]
    Xdesc = []
    if general == True:
            for i in range(len(supply)):
                descriptors = calc.CalcDescriptors(supply[i])
                Xdesc.append(descriptors)
                df_desc = pd.DataFrame(Xdesc)
                df_desc.columns = RDKitDescNames
    else:
       df_desc = pd.DataFrame()
    X = pd.concat([df_fp, df_desc], axis=1)
    df_fp = 0
    df_desc = 0
    X = X.astype('float32')
    X = X.replace([np.inf, -np.inf], np.nan)
    X = X.fillna(X.mean())
    print(X.columns)
    return(X) 






